import React from 'react';
import './Section.css';

function Promotion() {
  return (
    <div className="section promotion">
      <h2>Ready to experience Unparalleled Service and Care?</h2>
      <p>
        Join us and enjoy exclusive deals, personalized services, and the best care tips for your beloved pets.
      </p>
      <button>Shop Now</button>
    </div>
  );
}

export default Promotion;
